const DUMMY_EVENTS = [
  {
    id: "e1",
    title: "First Event",
  },
  {
    id: "e2",
    title: "Secode Event",
  },
  {
    id: "e3",
    title: "Third Event",
  },
  {
    id: "e4",
    title: "Fourth Event",
  },
];

export default function Events() {
  return (
    <>
      {DUMMY_EVENTS.map((event) => (
        <li>{event.title}</li>
      ))}
    </>
  );
}
